<?php declare(strict_types=1);
namespace Sohophp\SchemaOrg\Thing\CreativeWork\Article;

use Sohophp\SchemaOrg\Thing\CreativeWork\Article;

/**
* A Report generated by governmental or non-governmental organization.
* @see http://schema.org/Report
* @package Sohophp\SchemaOrg\Thing\CreativeWork\Article

*
*/
class Report extends Article
{

    /**
    * The number or other unique designator assigned to a Report by the publishing organization.
    * @param string|array $value
    * @return $this
    */
    public function reportNumber(?string $value)
    {
        $this->setProperty('reportNumber', $value);
        return $this;
    }
   /**
    * @param string|array $value
    * @return $this
    */
    public function setReportNumber(?string $value)
    {
        $this->setProperty('reportNumber', $value);
        return $this;
    }
    /**
    * @return $this|string|array
    */
    public function getReportNumber()
    {
       return $this->getProperty('reportNumber');
    }


}


class_alias('Sohophp\\SchemaOrg\\Thing\\CreativeWork\\Article\\Report','Thing\\Report');

